import React from 'react'

export default function Card(props) {
  if(props.id)
  return (
    <div className='card'>
        <img src={props.image}></img>
        <div className='sidediv'>
          <h1>{props.name}</h1>
          <p>{props.text}</p>
        </div>
    </div>
  )
}
